import string
def solve(arr):
    answers = [0]*(len(arr))
    alphs = list(string.ascii_lowercase)
    for i in range(len(arr)):
        count = 0
        if len(arr[i]) > 26:
          length = 26
        else:
          length = len(arr[i])
        for j in range(length):
            if  arr[i][j].lower() == alphs[j]:
                count +=1
        answers[i] = count
    return (answers)

